// src/App.js
import React, { useState, useEffect } from "react";
import { BrowserRouter as Router, Routes, Route, useNavigate } from "react-router-dom";

import tataLogo from "./assets/Tata-logo.png";
import tataQuoteLogo from "./assets/tata_quote_logo.png";
import tataItLogo from "./assets/Tata-it-logo.png";

import VF1_ACFillingForm from "./components/VF1_ACFillingForm";
import VF2_ACFillingForm from "./components/VF2_ACFillingForm";
import VF3_ACFillingForm from "./components/VF3_ACFillingForm";

import VF1_UreaFillingForm from "./components/VF1_UreaFillingForm";
import VF2_UreaFillingForm from "./components/VF2_UreaFillingForm";
import VF3_UreaFillingForm from "./components/VF3_UreaFillingForm";

import VF1_ClutchProcessForm from "./components/VF1_ClutchFillingForm";
import VF2_ClutchProcessForm from "./components/VF2_ClutchFillingForm";
import VF3_ClutchProcessForm from "./components/VF3_ClutchFillingForm";

import VF1_CoolantProcessForm from "./components/VF1_CoolantProcessForm";
import VF2_CoolantProcessForm from "./components/VF2_CoolantProcessForm";
import VF3_CoolantProcessForm from "./components/VF3_CoolantProcessForm";

import VF1_PowerSteeringForm from "./components/VF1_PowerSteeringForm";
import VF2_PowerSteeringForm from "./components/VF2_PowerSteeringForm";
import VF3_PowerSteeringForm from "./components/VF3_PowerSteeringForm";

import VF3_DieselFillingForm from "./components/VF3_DieselFillingForm"; // Only VF3 has Diesel

const Dashboard = () => {
  const [selectedArea, setSelectedArea] = useState("");
  const [selectedMachine, setSelectedMachine] = useState("");
  const [machineOptions, setMachineOptions] = useState([]);

  const navigate = useNavigate();

  const areaOptions = ["VEHICLE FACTORY 1", "VEHICLE FACTORY 2", "VEHICLE FACTORY 3"];

  const machinesByArea = {
    "VEHICLE FACTORY 1": ["AC FILLING MACHINE", "UREA FILLING MACHINE", "CLUTCH OIL FILLING MACHINE", "COOLANT OIL FILLING MACHINE", "POWER STEERING OIL FILLING MACHINE"],
    "VEHICLE FACTORY 2": ["AC FILLING MACHINE", "UREA FILLING MACHINE", "CLUTCH OIL FILLING MACHINE", "COOLANT OIL FILLING MACHINE", "POWER STEERING OIL FILLING MACHINE"],
    "VEHICLE FACTORY 3": ["AC FILLING MACHINE", "UREA FILLING MACHINE", "CLUTCH OIL FILLING MACHINE", "COOLANT OIL FILLING MACHINE", "POWER STEERING OIL FILLING MACHINE", "DIESEL OIL FILLING MACHINE"],
  };

  useEffect(() => {
    if (selectedArea) {
      setMachineOptions(machinesByArea[selectedArea] || []);
      setSelectedMachine(""); // Reset machine when area changes
    }
  }, [selectedArea]);

  const handleSubmit = () => {
    if (!selectedArea || !selectedMachine) {
      alert("Please select both area and machine.");
      return;
    }

    // Routing based on selected area and machine
    const routeMap = {
      "VF1_AC Filling": "/vf1-ac",
      "VF2_AC Filling": "/vf2-ac",
      "VF3_AC Filling": "/vf3-ac",

      "VF1_Urea Filling": "/vf1-urea",
      "VF2_Urea Filling": "/vf2-urea",
      "VF3_Urea Filling": "/vf3-urea",

      "VF1_Clutch Process": "/vf1-clutch",
      "VF2_Clutch Process": "/vf2-clutch",
      "VF3_Clutch Process": "/vf3-clutch",

      "VF1_Coolant Process": "/vf1-coolant",
      "VF2_Coolant Process": "/vf2-coolant",
      "VF3_Coolant Process": "/vf3-coolant",

      "VF1_Power Steering": "/vf1-power",
      "VF2_Power Steering": "/vf2-power",
      "VF3_Power Steering": "/vf3-power",

      "VF3_Diesel Filling": "/vf3-diesel",
    };

    const route = routeMap[`${selectedArea}_${selectedMachine}`];
    if (route) {
      navigate(route);
    } else {
      alert("Form not available for this combination.");
    }
  };

  return (
    <div className="bg-gray-900 text-white min-h-screen">
      <div className="p-4 flex justify-between items-center bg-gray-800 shadow-md">
        <img src={tataLogo} alt="Tata Logo" className="h-12" />
        <img src={tataQuoteLogo} alt="Tata Quote" className="h-10" />
        <img src={tataItLogo} alt="Tata IT Logo" className="h-12" />
      </div>

      <div className="p-8">
        <h1 className="text-3xl mb-6 text-center font-bold">Tata Motors Data Traceability Portal</h1>

        <div className="grid grid-cols-1 md:grid-cols-2 gap-6 max-w-xl mx-auto">
          <div>
            <label className="block mb-2 font-semibold">Select Vehicle Factory:</label>
            <select
              value={selectedArea}
              onChange={(e) => setSelectedArea(e.target.value)}
              className="w-full p-2 rounded text-black"
            >
              <option value="">-- Select Area --</option>
              {areaOptions.map((area) => (
                <option key={area} value={area}>{area}</option>
              ))}
            </select>
          </div>

          <div>
            <label className="block mb-2 font-semibold">Select Machine:</label>
            <select
              value={selectedMachine}
              onChange={(e) => setSelectedMachine(e.target.value)}
              className="w-full p-2 rounded text-black"
            >
              <option value="">-- Select Machine --</option>
              {machineOptions.map((machine) => (
                <option key={machine} value={machine}>{machine}</option>
              ))}
            </select>
          </div>
        </div>

        <div className="text-center mt-6">
          <button
            onClick={handleSubmit}
            className="bg-blue-600 hover:bg-blue-700 text-white px-6 py-2 rounded shadow"
          >
            Submit
          </button>
        </div>
      </div>
    </div>
  );
};

// Wrap Dashboard with Routes
const App = () => {
  return (
    <Router>
      <Routes>
        <Route path="/" element={<Dashboard />} />

        <Route path="/vf1-ac" element={<VF1_ACFillingForm />} />
        <Route path="/vf2-ac" element={<VF2_ACFillingForm />} />
        <Route path="/vf3-ac" element={<VF3_ACFillingForm />} />

        <Route path="/vf1-urea" element={<VF1_UreaFillingForm />} />
        <Route path="/vf2-urea" element={<VF2_UreaFillingForm />} />
        <Route path="/vf3-urea" element={<VF3_UreaFillingForm />} />

        <Route path="/vf1-clutch" element={<VF1_ClutchProcessForm />} />
        <Route path="/vf2-clutch" element={<VF2_ClutchProcessForm />} />
        <Route path="/vf3-clutch" element={<VF3_ClutchProcessForm />} />

        <Route path="/vf1-coolant" element={<VF1_CoolantProcessForm />} />
        <Route path="/vf2-coolant" element={<VF2_CoolantProcessForm />} />
        <Route path="/vf3-coolant" element={<VF3_CoolantProcessForm />} />

        <Route path="/vf1-power" element={<VF1_PowerSteeringForm />} />
        <Route path="/vf2-power" element={<VF2_PowerSteeringForm />} />
        <Route path="/vf3-power" element={<VF3_PowerSteeringForm />} />

        <Route path="/vf3-diesel" element={<VF3_DieselFillingForm />} />
      </Routes>
    </Router>
  );
};

export default App;
